<script setup lang="ts">
document.addEventListener('DOMContentLoaded', () => {
    const tooltip = document.getElementById('tooltip') as HTMLElement;

    // Province names corresponding to path IDs in SVG
    const provinces: string[] = [
        "Phnom Penh", "Banteay Meanchey", "Battambang", "Kampong Cham", "Kampong Chhnang",
        "Kampong Speu", "Kampong Thom", "Kampot", "Kandal", "Koh Kong", 
        "Kratie", "Mondulkiri", "Oddar Meanchey", "Pailin", "Preah Vihear",
        "Prey Veng", "Pursat", "Ratanakiri", "Siem Reap", "Preah Sihanouk",
        "Stung Treng", "Svay Rieng", "Takeo", "Tbong Khmum", "Kep"
    ];

    provinces.forEach((provinceName, index) => {
        const path = document.getElementById(`province${index + 1}`) as HTMLElement;

        if (path) {
            path.addEventListener('mouseover', () => {
                tooltip.textContent = provinceName;
                tooltip.classList.remove('hidden');
                tooltip.classList.add('visible');
            });

            path.addEventListener('mousemove', (e: MouseEvent) => {
                tooltip.style.left = `${e.pageX + 10}px`;
                tooltip.style.top = `${e.pageY + 10}px`;
            });

            path.addEventListener('mouseout', () => {
                tooltip.classList.remove('visible');
                tooltip.classList.add('hidden');
            });
        }
    });
});

</script>

